import styled from 'styled-components';

const Border = styled.div`
overflow: hidden;
background: transparent;
position: absolute;
right: 0;
width: 38%;
height: 24%;
bottom: 19.5%;
border-bottom: 2px solid black;
`

const MiniGraph = () => {
    return (
        <Border>  <h1> Import Graph Here</h1> </Border>
    )
}

export default MiniGraph
